Selma vertelt het verhaal van Martin Luther King die een historische strijd aanging om stemrecht te garanderen voor alle mensen. Een gevaarlijke en angstaanjagende campagne met een epische protestmars in Selma (Alabama), die uiteindelijk leidde tot de ondertekening van de Voting Rights Act door president Johnson in 1965.
